-- Tablo Adı: admin
-- Satır Sayısı: 2

CREATE TABLE `admin` (
  `Id` int(255) NOT NULL,
  `admin_kadi` varchar(255) CHARACTER SET utf8 COLLATE utf8_turkish_ci NOT NULL,
  `admin_sifre` varchar(255) CHARACTER SET utf8 COLLATE utf8_turkish_ci NOT NULL,
  `saat` varchar(255) NOT NULL,
  `komisyon` varchar(255) DEFAULT '2',
  `kredi` varchar(255) DEFAULT '4'
) ENGINE=InnoDB DEFAULT CHARSET=utf8;






-- Tablo Adı: faturaler
-- Satır Sayısı: 521

CREATE TABLE `faturaler` (
  `id` int(255) NOT NULL AUTO_INCREMENT,
  `fatura_ad` varchar(255) NOT NULL,
  `fatura_no` varchar(255) NOT NULL,
  `isletme_no` varchar(250) CHARACTER SET utf8 COLLATE utf8_turkish_ci NOT NULL,
  `fatura_tutar` varchar(255) NOT NULL,
  `fatura_zaman` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `fatura_sonodeme` varchar(255) NOT NULL,
  `fatura_onay` enum('0','1') CHARACTER SET utf8 COLLATE utf8_turkish_ci NOT NULL DEFAULT '0',
  `fatura_kar` varchar(255) CHARACTER SET utf8 COLLATE utf8_turkish_ci NOT NULL DEFAULT '2',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=533 DEFAULT CHARSET=utf8;






